            "\", 1), groupSP) +\r\n                    Concat(A + 1, In(\"LCC\", A) + \",\" + groupS" +
            "P + \"CM\") :\r\n                    Concat(A + 1, In(\"LCC\", A) + \",\" + In(\"B\", C + " +
