            "o_string(p.BiasesGain) + \")\" : \"\") + (p.BiasesScaleVisible ? \"(\" + to_string(p.B" +
            "iasesScale) + \")\" : \"\") + nwl +\r\n                (p.BiasesLRM != 1 ? \"BiasesLRM=" +
            "\" + to_string(p.BiasesLRM) + nwl : \"\") +\r\n                (p.BiasesWDM != 1 ? \"B" +
