            "n(C + 1, In(\"C\", C), p.Activation) +\r\n                                        Co" +
            "nvolution(C + 1, In(\"B\", C + 1), DIV8(p.GrowthRate), 3, 3, 1, 1, 1, 1) +\r\n      " +
            "                                  (p.Dropout > 0 ? Dropout(C + 1, In(\"C\", C + 1)" +
